import React from 'react';
import '../styles/footer.css';
import { Link } from "react-router-dom";

import GitHubIcon from '@mui/icons-material/GitHub';
import InstagramIcon from '@mui/icons-material/Instagram';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import Logo from '../assets/Logo_LSC.png';

function Footer() {
  return (
    <footer>
      <img src={Logo} alt=""/>
      <div className="footerIcons">
        <a href="https://github.com/Luis-Antonio-CR" target="_blank"> <GitHubIcon /> </a>
        <a href="https://www.linkedin.com/in/luis-antonio-c-73852bb5/" target="_blank"> <LinkedInIcon /> </a>
        <a href="https://github.com/Luis-Antonio-CR" target="_blank"> <InstagramIcon /> </a>
      </div>
    </footer>
  )
}

export default Footer
